import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Header from './components/Header';
import ProductionSidebar from './components/ProductionSidebar';
import InputForm from './components/InputForm';  
import InputForm2 from './components/InputForm2';  // 새로운 InputForm2 컴포넌트 임포트
import ProductionPage from './components/ProductionPage';
import ProductionPage2 from './components/ProductionPage2';  // 새로운 ProductionPage2 컴포넌트 임포트
import ProductionPage8 from './components/ProductionPage8';  // 새로운 ProductionPage8 컴포넌트 임포트

function App() {
    return (
        <Router>
            <Header />
            <div className="custom-container" style={{ display: 'flex' }}>
                <ProductionSidebar />
                <div className="main-content">
                    <Routes>
                        {/* 메인 페이지 */}
                        <Route path="/" element={<div>Main Page Content</div>} />

                        {/* 생산 관리 페이지 */}
                        <Route path="/production" element={<ProductionPage />} />
                        <Route path="/input" element={<InputForm />} />
                        <Route path="/input2" element={<InputForm2 />} />
                        <Route path="/production2" element={<ProductionPage2 />} />
                        <Route path="/production8" element={<ProductionPage8 />} />
                        {/* 추가 경로들 필요시 확장 가능 */}
                    </Routes>
                </div>
            </div>
        </Router>
    );
}

export default App;
